style.css:
@-moz-document domain("sixt.com"), domain("sixt.de"), domain("sixt.at"), domain("sixt.ch") {
.sx-gc-debug,
    .sx-res-config-plus-minus span.sx-gc-debug {
        height: auto;
        width: auto;
        margin: 0;
        padding: 0 1px 0 1px;
        background-image: none;
        display: block;
        zoom: 1;
        color: red;
    }

.sx-res-offerlist-item:before, .sx-res-offerlist-item:after {
    content:attr(onclick);
    display: block;
    color: red;
}

.sx-gc-button-cta {
    color: black !important;
}

.sx-gc-button-cta:after {
    content:attr(onclick);
    display: block;
    color: white;
    font-size: smaller;
}

.sx-res-offerlist-offerexample {
    width: 10%;
}
}
